import styled from 'styled-components';


export const ClockStyle = styled.div`

        font-size: 11px;
        margin-top: 16px;
        font-family: 'Nunito Sans', sans-serif;
        text-transform: uppercase;
        animation: go-back 1s infinite alternate;


    @keyframes go-back {
    from {
        transform: translateX(100px);
    }
    to {
        transform: translateX(-100px);
    }



`;
